class Schedule {
  constructor(name) {
    this.name = name;
    this.courses = [];
  }

  addCourse(course) {
    this.courses.push(course);
  }

  removeCourse(course) {
    const index = this.courses.indexOf(course);
    if (index > -1) {
      this.courses.splice(index, 1);
    }
  }

  // define methods for modifying the schedule object as needed
}

export default Schedule;
